import React from 'react';
import { Card as BootstrapCard, Button } from 'react-bootstrap';

const CardMenu = (props) => {
    const { src, title, className } = props;

    return (
        <BootstrapCard className={`col-3 pt-3 rounded-3 ${className}`} style={{ width: '15rem' }}>
            <BootstrapCard.Img src={src} alt="..." />
            <BootstrapCard.Body>
                <BootstrapCard.Title>{title}</BootstrapCard.Title>
                <Button variant="primary" className="btnOFF">Acesse</Button>
            </BootstrapCard.Body>
        </BootstrapCard>
    );
}

export default CardMenu;
